import React from 'react'

const Hero = () => {
    return (
        <div>
            <div>STAGELINK</div>
            <div>Bridging sport tickets and cryptocurrency</div>
            <div>Buy STAGELINK</div>
            <div>View Chart</div>
        </div>
    )
}

const About = () => {
    return (
        <div>
            <div>What is STAGELINK</div>
            <div>ELONGATE is a cryptocurrency token on the Binance Smart Chain.</div>
            <div>A 10% transaction fee rewards holders and donates significant sums to charity.</div>
            <div>Holders don't need to do anything other than hold their tokens in order to earn rewards.</div>
        </div>
    )
}

const Home = () => {
    return (
        <div>
            <div><Hero /></div>
            <div><About /></div>
        </div>
    )
}

export default Home
